function Priloader(elid, params) {

	this.base64img = "data:image/png;base64,";

	params = params || {}
	this.params = {};

	this.params.size = params.size || 48;
	this.params.size = this.params.size > 168 ? 168 : this.params.size;
	this.params.size = this.params.size < 24 ? 24 : this.params.size;

	this.params.bgColor = params.bgColor || false;
	
	// speed goes from 1 to 5
	this.params.speed = params.speed || 3;
	this.params.speed = this.params.speed < 1 ? 1 : this.params.speed;
	this.params.speed = this.params.speed > 5 ? 5 : this.params.speed;

	this.params.className = params.className || false;

	this.params.color = params.color || false;

	this.interval = 80 - this.params.speed*10;

	if(elid instanceof HTMLElement) {
		this.el = elid;
		this.elid = elid.id;
	}else{
		this.elid = elid;
		this.el = document.getElementById(elid);
	}
	this.el.style.width = this.params.size+"px";
	this.el.style.height = this.params.size+"px";
	this.el.style.visibility = "hidden";
	if(this.params.className) {
		var classes = [
			this.el.className,
			this.params.className
			]
		this.el.className = classes.join(" ");
	}

	this.container = document.createElement("div");
	this.container.setAttribute("class", "priloader-container");
	this.container.style.width = this.params.size+"px";
	this.container.style.height = this.params.size+"px";
	if(this.params.bgColor) {
		this.container.style.backgroundColor = this.params.bgColor;
	}
	this.el.appendChild(this.container);

		
	this.hexToRGB = function(hexStr) {
	    var col = {};
    	col.r = parseInt(hexStr.substr(1,2),16);
	    col.g = parseInt(hexStr.substr(3,2),16);
    	col.b = parseInt(hexStr.substr(5,2),16);
	    return col;
	}

	var instance = this;
	var img = document.createElement("img");
		img.src = this.base64img;
	   	img.style.visibility = "hidden";
		img.style.position = "absolute";

	img.onload = function() {
		
		if(instance.params.color) {

			var canvas = document.createElement("canvas");
				canvas.setAttribute("width", img.offsetWidth+"px");
				canvas.setAttribute("height", img.offsetHeight+"px");
				canvas.style.visibility="hidden";
				canvas.style.position="absolute";

			var ctx = canvas.getContext("2d");
			if(ctx) {

				ctx.drawImage(img,0,0);

				var imageData = ctx.getImageData(0,0,img.offsetWidth,img.offsetHeight);
				var data = imageData.data;

				var rgbfrom = instance.hexToRGB("#000000");
				var rgbto = instance.hexToRGB(instance.params.color);
				var r,g,b;
				for(var x = 0, len = data.length; x < len; x+=4) {
					r = data[x];
					g = data[x+1];
					b = data[x+2];
					if((r == rgbfrom.r) && (g == rgbfrom.g) && (b == rgbfrom.b)) {
						data[x] = rgbto.r;
						data[x+1] = rgbto.g;
						data[x+2] = rgbto.b;
					} 
				}
				ctx.putImageData(imageData,0,0);
				instance.base64img = canvas.toDataURL();
			}
			instance.el.removeChild(this);

		}
		instance.spinner = document.createElement("div");
		instance.spinner.setAttribute("class","priloader-spinner");
		instance.spinner.style.width = instance.params.size+"px";
		instance.spinner.style.height = instance.params.size+"px";
		instance.spinner.style.backgroundImage = "url("+instance.base64img+")";
		instance.spinner.style.backgroundRepeat = "no-repeat";
		instance.spinner.style.backgroundPosition = "0% 0%";
		instance.spinner.style.backgroundSize = instance.params.size+"px "+instance.params.size+"px";
		instance.container.appendChild(instance.spinner);

	}	

	this.el.appendChild(img);
	
	this.start = function(){
		var instance = this;
		this.deg = 0;
		this.el.style.visibility = "visible";
		this.intervalID = setInterval(function(){
			instance.animate();			
		}, this.interval);
	}

	this.stop = function() {
		this.el.style.visibility = "hidden";
		clearInterval(this.intervalID);
	}

	this.deg = 0;
	this.animate = function() {
		this.deg = this.deg + 10 > 350 ? 0 : this.deg + 10;	
		this.spinner.style.webkitTransform = 'rotate('+this.deg+'deg)'; 
	    this.spinner.style.mozTransform    = 'rotate('+this.deg+'deg)'; 
    	this.spinner.style.msTransform     = 'rotate('+this.deg+'deg)'; 
	    this.spinner.style.oTransform      = 'rotate('+this.deg+'deg)'; 
    	this.spinner.style.transform       = 'rotate('+this.deg+'deg)'; 
	}
}
